import { useEffect, useState } from "react";
import gsap from "gsap";
import React from "react";
import { ScrollTrigger } from "gsap/ScrollTrigger";

// Sample software data
const softwareList = [
  { id: 1, name: "Game Booster", desc: "Optimize your PC for gaming.", img: "https://img.freepik.com/free-vector/outer-space-mission-game-tablet-screen_1308-45981.jpg?t=st=1741618645~exp=1741622245~hmac=5cab3ad6a8d37f8b8ab6b6b172a6a8cde9abc386a1ca8540c08fce02af72a368&w=740" },
  { id: 2, name: "FPS Unlocker", desc: "Increase FPS for smooth gameplay.", img: "fps-unlocker.jpg" },
  { id: 3, name: "VR Enhancer", desc: "Enhance VR experiences.", img: "https://img.freepik.com/free-photo/man-with-futuristic-device-medium-shot_23-2148864986.jpg?uid=R184368195&ga=GA1.1.1730821936.1741618603&semt=ais_hybrid" },
  { id: 4, name: "Shader Mod", desc: "Upgrade game graphics.", img: "https://shadersmods.com/wp-content/uploads/2022/06/astralex-shaders-928x522.png" },
  { id: 5, name: "Anti-Cheat Bypass", desc: "Play safely online.", img: "https://img.freepik.com/free-vector/phishing-illustration-hacker-stealing-credit-card-from-app-cybercrime_1150-37365.jpg?uid=R184368195&ga=GA1.1.1730821936.1741618603&semt=ais_hybrid" },
  { id: 6, name: "Low Latency Mode", desc: "Reduce input lag.", img: "data:image/png;base64," },
  { id: 7, name: "Gaming VPN", desc: "Unblock gaming servers.", img: "https://img.freepik.com/free-vector/hand-drawn-flat-design-vpn-illustration_23-2149258063.jpg?uid=R184368195&ga=GA1.1.1730821936.1741618603&semt=ais_hybrid" }
];

gsap.registerPlugin(ScrollTrigger);

export default function IntroApp() {
  const [selectedSoftware, setSelectedSoftware] = useState(null);

  useEffect(() => {
    gsap.to(".box", {
      xPercent: -100 * (softwareList.length - 1),
      ease: "none",
      scrollTrigger: {
        trigger: ".wrapper",
        start: "top top",
        end: "bottom center",
        scrub: 1,
        pin: true
      }
    });
  }, []);

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-black rounded-3xl  text-white">
      <div className="relative flex overflow-hidden w-4/5 h-[80vh] bg-black rounded-lg">
        {softwareList.map((software) => (
          <div
            key={software.id}
            className="box flex-shrink-0 w-1/3 h-full flex flex-col items-center justify-center p-4 bg-white mx-2 cursor-pointer hover:bg-gray-600 transition"
          >
            <img src={software.img} alt={software.name} className="w-[40%] h-[auto] object-cover py-4 hover:scale-105 hover:border-black border-1 px-2 border-black  " />
            <h3 className="text-lg text-black p-2 font-bold">{software.name}</h3>
            <div className="flex py-4 px-2 gap-2">
              <button
                className="px-4 py-2 bg-blue-600 hover:bg-blue-700 rounded-lg"
                onClick={() => setSelectedSoftware(software)}
              >
                View Details
              </button>
              
              <button className="px-4 py-2 bg-green-600 hover:bg-green-700 rounded-lg">
                Download Free Source
              </button>
            </div>
          </div>
        ))}
      </div>
      {selectedSoftware && (
        <div className="fixed inset-0 flex items-center justify-center bg-black bg-opacity-50">
          <div className="bg-gray-800 p-6 rounded-lg w-1/3">
            <h2 className="text-xl font-bold mb-2">{selectedSoftware.name}</h2>
            <p className="mb-4">{selectedSoftware.desc}</p>
            <button className="px-4 py-2 bg-red-600 hover:bg-red-700 rounded-lg" onClick={() => setSelectedSoftware(null)}>Close</button>
          </div>
        </div>
      )}
    </div>
  );
}
